import PropTypes from 'prop-types';

const Header = ({title}) => {
    return (
        <header>
            <h1 style={headingStyle}>{title}</h1>
        </header>
    )
};

Header.defaultProps = {
    title: 'working title'
};

Header.protoTypes = {
    title: PropTypes.string
};

///
const headingStyle = {color: 'red', backgroundColor:'blue'};

export default Header;
